export const COLUMNS = [
    {
        Header: "NAME",
        accessor: "name"
    },
    {
        Header: "ROLL NUMBER",
        accessor: "roll_no"
    },
    {
        Header: "MATHS SCORE",
        accessor: "maths_score"
    },
    {
        Header: "PHYSICS SCORE",
        accessor: "physics_score"
    },
    {
        Header: "CHEMESTRY SCORE",
        accessor: "chemestry_score"
    },
    {
        Header: "TOTAL",
        accessor: "total"
    },
    {
        Header: "PERCENTAGE",
        accessor: "percentage"
    }
]
